      <text id="30" justification="0" size="4" underlined="false">
        <text>领域知识：装修设计预约平台

1 客户通过系统预约设计师进行装修设计，客户只能预约一个设计师订单，不能预约多个同时进行设计。
2 预约后，设计师上门进行量房，根据面积进行报价和预估设计时间。
3 客户接受报价后，进行付款，设计师开始设计；如果拒绝，则设计师可以进行再次报价和预估设计时间。
4 客户在付款之前，都可以进行终止。
5 设计师完成设计后，提出完成订单请求，客户接受后确定结束。
6 客户可以对完成的订单进行评价。</text>
